import { useEffect, useState } from "react";
import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const OrdersPage = () => {
    // states
    const [refresh, setRefresh] = useState(false)
    const [orders, setOrders] = useState([
        {

            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 1",
            "category_name": "Category 2",
            "status": "ACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 2",
            "category_name": "Category 1",
            "status": "ACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 3",
            "category_name": "Category 6",
            "status": "ACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 4",
            "category_name": "Category 6",
            "status": "INACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 5",
            "category_name": "Category 5",
            "status": "ACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 6",
            "category_name": "Category 3",
            "status": "INACTIVE"
        },
        {
            "order_image": "data:image/jpeg;base64,",
            "order_name": "Order 7",
            "category_name": "Category 7",
            "status": "ACTIVE"
        },
        {
            "order_image": "data:image/png;base64,",
            "order_name": "Order 8",
            "category_name": "Category 4",
            "status": "ACTIVE"
        }
    ])

    // use effect
    useEffect(() => {
        console.log('Refreshed');
    }, [refresh]);

    // status change
    const changeStatus = (index, status) => {
        orders[index].status = status
        setOrders(orders)
        setRefresh(!refresh)
    }

    // return
    return (
        <>
            <NavbarComponent now={'orders'} />
            <SidebarComponent now={'orders'} />
            <div className="w-auto min-h-screen px-3 pt-16 md:ml-60 lg:ml-80 bg-gray-900">
                <div className="w-full min-h-screen bg-gray-700 rounded-lg px-5 py-5 mt-3">
                    {/* Table */}
                    <div className="w-full bg-gray-900 overflow-x-auto rounded-xl">
                        <table className="w-full table-auto border-collapse border border-gray-400">
                            <thead>
                                <tr>
                                    <th className="text-md border border-gray-500 px-4 py-2 bg-yellow-500 capitalize">
                                        Order Image
                                    </th>
                                    <th className="text-md border border-gray-500 px-4 py-2 bg-yellow-500 capitalize">
                                        Order Name
                                    </th>
                                    <th className="text-md border border-gray-500 px-4 py-2 bg-yellow-500 capitalize">
                                        Category Name
                                    </th>
                                    <th className="text-md border border-gray-500 px-4 py-2 bg-yellow-500 capitalize">
                                        Status
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {orders.map((item, index) => (
                                    <tr key={index}>
                                        <td className="border text-white text-sm border-gray-500 px-4 py-2">
                                            <img src={item.order_image} alt="Example" className="rounded-md shadow-lg h-10" />
                                        </td>
                                        <td className="border text-white text-sm border-gray-500 px-4 py-2">
                                            {item.order_name}
                                        </td>
                                        <td className="border text-white text-sm border-gray-500 px-4 py-2">
                                            {item.category_name}
                                        </td>
                                        <td className="border text-white text-xs border-gray-500 px-4 py-2">
                                            <div className="w-full flex justify-center">
                                                <div onClick={() => changeStatus(index, item.status === "ACTIVE" ? "INACTIVE" : "ACTIVE")} className="w-20 bg-gray-600 rounded-full shadow-md shadow-inner">
                                                    {
                                                        item.status === "ACTIVE" ?
                                                            <div className="flex w-14 py-1 bg-green-700 rounded-full text-white font-bold ml-auto justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                            :
                                                            <div className="flex w-14 py-1 bg-red-600 rounded-full text-white font-bold justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                    }
                                                </div>
                                            </div>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                    {/* Table */}
                </div>
            </div>
        </>
    );
}

export default OrdersPage;
